// import {styles} from 'react-responsive-carousel/lib/styles/carousel.min.css';
import { Carousel } from 'react-responsive-carousel';
 
class DemoCarousel extends Component {
    render() {
        return (
            <Carousel showThumbs={false} >
                <div style={{display:"flex",margin:"20px 0px",padding:"40px",backgroundColor:"white"}}>
                    <div >
                        <h3 style={{margin:"0px",padding:"0px"}}>Featured</h3>
                        <div style={{width:"63%",fontSize:"20px",margin:"10px 0px"}}>
                            Learn how to value your Contribution
                        </div>
                    </div>
                    <div style={{width:"63%",display:"flex",alignItems:"center"}}>
